import React, { Component } from 'react';
import {StyledNavbar, MenuOptions} from './style'

export default class Navbar extends Component {
   constructor(props) {
     super(props)
   }
   render() {
      return(
            <StyledNavbar>
                <span>Brand</span> 
                <MenuOptions>
                    <li>About me</li>
                    <li>Projects</li>
                </MenuOptions> 
            </StyledNavbar>
      )
   }
}
